import React from "react";
import CurrentWeather from "./components/CurrentWeather";
import WeatherForecast from "./components/WeatherForecast";

import { CurrentWeatherData, WeatherCardData } from "./types/WeatherTypes";

const currentWeather: CurrentWeatherData = {
  temp: "26°C",
  condition: "Partly Cloudy",
  location: "Hanoi, Vietnam",
  icon: "fas fa-cloud-sun",
  time: "6:00 PM",
  feelsLike: "28°C",
  humidity: "65%",
  wind: "15 km/h",
};

const weatherData: WeatherCardData[] = [
  { day: "TONIGHT", date: "11/30", temp: "16°", condition: "Clear", icon: "fas fa-moon", precip: "2%" },
  { day: "SUN", date: "12/1", temp: "27° 20°", condition: "Partly sunny", icon: "fas fa-cloud-sun", precip: "1%" },
  { day: "MON", date: "12/2", temp: "26° 21°", condition: "Afternoon rain", icon: "fas fa-cloud-showers-heavy", precip: "55%" },
];

function App() {
  return (
    <div className="flex gap-4">
      <CurrentWeather data={currentWeather} />
      <WeatherForecast data={weatherData} />
    </div>
  );
}

export default App;
